    false,nt"url": null,nt"notes": "This memorandum is a summary of 1994 duck
    production on the Monte Vista National Wildlife refuge.  Nest density, nest success,
    species composition, nesting cover, and overall production were analyzed.  A data
    set of apparent nest success, nest density and number of ducks produced annually
    on Monte Vista NWR from 1964-1994 and number of nests found on transects on a unit
    basis for 1988-1994 is included, as well as a map of the survey transect locations
    and an example field form for the waterfowl production survey (that can be found
    in the instructions for conducting the waterfowl production survey based on duck
    nesting transects for Monte Vista NWR).",nt"license_title": "License Not Specified",nt"extras":
